import React from "react";

import { NavLink } from "react-router-dom";

const Navigation = () => {
  return (
    <div>
      <div id='globalnav'>
        <div id='gnavLogo'>
          <img src='https://kommunikation-marketing.uni-koeln.de/e135228/e136450/e136573/e136614/e136634/013_Unisiegel_plus_Schriftzug_DE_ger.jpg'></img>
        </div>
        <NavLink to='/Kontakt'>Kontakt</NavLink>
        <NavLink to='/Kartenviewer'>Infos</NavLink>
        <NavLink to='/Kartenkatalog'>Gebäudeübersicht</NavLink>
        <NavLink to='/'>Lageplan</NavLink>
      </div>
    </div>
  );
};

export default Navigation;
